Hi!

I encountered an unexpected behavior when working with:

* _.round
* as iteratee shorthand
* when iterating on an object with numbers as keys

Here what it looks like:
```javascript
const count1 = {
  "2": 33.333333333333336,
  "5": 66.66666666666667
};

const countPercent1 = _.mapValues(count1, _.round);

console.log('iteratee shorthand / numbers => NOK', countPercent1);
// "iteratee shorthand / numbers => NOK" Object {
//   2: 33.33,
//   5: 66.66667
// }
```

It works well when working with strings or when using a callback instead of the shorthand iteratee.
Here is a CodePen with the example: https://codepen.io/anon/pen/orooXW?editors=0012

When I was creating the pen, I realized why it behaved like this. When using a function (_.round here), lodash passes it 3 arguments:

* the value
* the index/key
* the whole object

As round take the precision as second argument, it alter the function behavior... It also mean that the same problem occurs with arrays.

I don't know if this can be considered a bug. I suppose that any modification on this matter will have too much aftermath.

However I didn't see any documentation on this. Is there any somewhere? It would prevent some people to fall into this trap.
